import React from "react";
import UserInterface from "./componets/UserInterface";
import Background from "./componets/Background";
import Header from "./componets/Header";
import SearchIcon from "./componets/SearchIcon";
import './styles/SearchLongInput.css';
import SearchLongInput from "./componets/SearchLongInput";
import ProfileIcon from "./componets/ProfileIcon";
import Message from "./componets/Message";
import ListRestaurant from "./componets/ListRetaurant";
import RestaurtantItem from "./componets/RestaurantItem";
import Navigation from "./componets/Navigation";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import TopRated from "./TopRated";

function AllRestaurants() {
  return (
    <div>
    <Header/>
    <Background/>
    <UserInterface/>
    <SearchIcon>
    <SearchLongInput/>
    </SearchIcon>
    <ProfileIcon/>
    <Navigation/>
    <Message>
      Де Смачніше?
    </Message>
    <ListRestaurant>
      <RestaurtantItem/>
      <RestaurtantItem/>
      <RestaurtantItem/>
      <RestaurtantItem/>
      <RestaurtantItem/>
      <RestaurtantItem/>
      <RestaurtantItem/>
      <RestaurtantItem/>
      <RestaurtantItem/>
      <RestaurtantItem/>
      <RestaurtantItem/>
      <RestaurtantItem/>
      <RestaurtantItem/>
    </ListRestaurant>
    <Router>
        <Routes  path="/TopRated" element={<TopRated />} />
      </Router>
    </div>

  );
}

export default AllRestaurants;
